import React from 'react'
import { Grid, Icon, Segment,Image, Button, } from 'semantic-ui-react'
const LandlordAccountReview = () => {
  return (
    <div style={{ minHeight: "100vh" }}>
      <Grid style={{ marginTop: "20px" }} verticalAlign='middle'>
        <Grid.Column floated='left' width={13}>
          <Segment
            textAlign='bottom'
            style={{
              backgroundImage: "url(/des2.jpg)",
              height: "30vh"
            }}
          >
<Image src='https://react.semantic-ui.com/images/wireframe/square-image.png' size='medium' circular />
          </Segment>
        </Grid.Column>

      </Grid>
    </div>
  )
}

export default LandlordAccountReview
